import React, { useState, useEffect } from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import "./Header.css";

function Header() {
  const [isAccountHovered, setIsAccountHovered] = useState(false);
  const [isLoggedIn, setIsLoggedIn] = useState(false); // Track login status

  // Log changes to the login state
  useEffect(() => {
    console.debug("Login status updated:", isLoggedIn);
  }, [isLoggedIn]);

  // Log hover state changes
  useEffect(() => {
    console.debug("Account hover state:", isAccountHovered);
  }, [isAccountHovered]);

  // Debug Logout Action
  const handleLogout = () => {
    console.debug("Logging out...");
    localStorage.removeItem("token"); // Clear user token
    setIsLoggedIn(false); // Update login state
    console.debug("Logged out. Login state:", isLoggedIn);
  };

  // Simulate login for testing purposes (replace with actual login logic)
  const simulateLogin = () => {
    console.debug("Simulating login...");
    localStorage.setItem("token", "dummy_token");
    setIsLoggedIn(true);
    console.debug("Logged in. Login state:", isLoggedIn);
  };

  return (
    <>
      <header className="bg-white border-bottom shadow-sm">
        <Navbar expand="lg" className="py-3">
          <Container>
            <Navbar.Brand href="#home">
              <img
                src="logo-placeholder.png" // Replace with your logo path
                alt="Salada Logo"
                className="logo"
              />
            </Navbar.Brand>

            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="mx-auto">
                <Nav.Link href="#shop" className="fw-bold text-dark">
                  Shop
                </Nav.Link>
                <Nav.Link href="#blog" className="fw-bold text-dark">
                  Blog
                </Nav.Link>
                <Nav.Link href="#about" className="fw-bold text-dark">
                  About Us
                </Nav.Link>
                <Nav.Link href="#rewards" className="fw-bold text-dark">
                  Rewards
                </Nav.Link>
                <Nav.Link href="#contact" className="fw-bold text-dark">
                  Contact
                </Nav.Link>
                <Nav.Link href="#find" className="fw-bold text-dark">
                  Find In Store
                </Nav.Link>
              </Nav>

              {/* Account and Cart */}
              <Nav className="ms-auto">
                <div
                  className="account-dropdown"
                  onMouseEnter={() => {
                    console.debug("Mouse entered account dropdown");
                    setIsAccountHovered(true);
                  }}
                  onMouseLeave={() => {
                    console.debug("Mouse left account dropdown");
                    setIsAccountHovered(false);
                  }}
                >
                  <Nav.Link href="#account" className="fw-bold text-dark">
                    {isLoggedIn ? "Your Account" : "Account"}
                  </Nav.Link>
                  {isAccountHovered && (
                    <div className="dropdown-menu">
                      {isLoggedIn ? (
                        <>
                          <a href="/account" className="dropdown-item">
                            Your Account
                          </a>
                          <button
                            className="dropdown-item"
                            onClick={() => {
                              console.debug("Logout button clicked");
                              handleLogout();
                            }}
                          >
                            Logout
                          </button>
                        </>
                      ) : (
                        <>
                          <a href="/login" className="dropdown-item">
                            Log in
                          </a>
                          <a href="/register" className="dropdown-item">
                            Register
                          </a>
                        </>
                      )}
                    </div>
                  )}
                </div>
                <Nav.Link href="#cart" className="fw-bold text-dark">
                  Cart (0)
                </Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
        {/* Test Login/Logout Buttons for Debugging */}
        <div style={{ margin: "20px", textAlign: "center" }}>
          <button onClick={simulateLogin} style={{ marginRight: "10px" }}>
            Simulate Login
          </button>
          <button onClick={handleLogout}>Simulate Logout</button>
        </div>
      </header>
    </>
  );
}

export default Header;
